		xx = ['left','right','center'].indexOf(x);
		yy = ['top','bottom','middle'].indexOf(y);
		
		if((xx === -1) && (yy === -1))
		{return 0;}
		
	    // Determine the x position in the sprite sheet
	    if (x === 'left') {
	        xPos = spriteW * 0;
	    } else if (x === 'right') {
	        xPos = spriteW * 2;
	    } else if (x === 'center') {
	        xPos = spriteW * 1;
	    }
	
	    // Determine the y position in the sprite sheet
