	        yPos = spriteH * 0;
	    } else if (y === 'bottom') {
	        yPos = spriteH * 2;
	    } else if (y === 'middle') {
	        yPos = spriteH * 1;
	    }
		
	    // Set the background position of the element
	    element.style.backgroundPosition = `${xPos}px ${yPos}px`;
		
	}
	
}

